        return new Source("{% extends 'base.html.twig' %}

{% block title %}{{ title }}{% endblock %}
{% block jumbotron %}
    <h1>{{ title }}</h1>
    <ol class=\"breadcrumb\">
        <li class=\"breadcrumb-item active\"><a href=\"{{ path('index') }}\">~</a></li>
        <li class=\"breadcrumb-item\"> </li>
    </ol>
{% endblock %}
{% block container %}
    <div class=\"row\">
    {% for article in articles %}
        <div class=\"col-md-4\">
            <div class=\"card\">
                <img class=\"card-img-top\" src=\"{{ asset(article.imagePath) }}\" alt=\"Card image cap\">
                <div class=\"card-block\">
                    <h5 class=\"card-title\">{{ article.title }}</h5>
                    <p class=\"card-text\">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href=\"{{ article.articlePath }}\" class=\"btn btn-sm btn-secondary\">read more</a>
                </div>
            </div>
        </div>
    {% endfor %}
    </div>
{% endblock %}", "basic_page/index.html.twig", "/home/patrickeinatz/Dokumente/websites/patrickeinatz/templates/basic_page/index.html.twig");
